// Casting globalThis to any allows us to look for `NativeNostrSdk`
// if it was added via JSI.
//
// We use a getter here rather than simply `globalThis.NativeNostrSdk` so that
// if/when the startup sequence isn't just so, an empty value isn't inadvertantly cached.
const getter: () => NativeModuleInterface = () =>
  (globalThis as any).NativeNostrSdk;
